"""
Solution for LC#706: Design HashMap
https://leetcode.com/problems/design-hashmap/
"""
import unittest


class ListNode:
    def __init__(self, key=-1, value=-1, next=None):
        self.key = key
        self.value = value
        self.next = next


class MyHashMap:
    def __init__(self):
        factor = 1_000
        self.emulated_hash_factor_callable = lambda key: key % factor
        # If you use the following, you'll get more than 500ms when executing test_example_2!
        # self.map = [ListNode()] * factor
        # Now using the guy bellow you'll get less than 20ms
        self.map = [ListNode() for _ in range(1_000)]

    def _retrieve_list_node(self, key):
        target_bucket = self.emulated_hash_factor_callable(key)
        return self.map[target_bucket]

    def put(self, key: int, value: int) -> None:
        head = self._retrieve_list_node(key)
        while head.next:
            if head.next.key == key:
                head.next.value = value
                return
            head = head.next
        head.next = ListNode(key, value)

    def get(self, key: int) -> int:
        head = self._retrieve_list_node(key)
        while head.next:
            if head.next.key == key:
                return head.next.value
            head = head.next
        return -1

    def remove(self, key: int) -> None:
        head = self._retrieve_list_node(key)
        while head.next:
            if head.next.key == key:
                head.next = head.next.next
                return
            head = head.next


